package bean;

public class topctybean {

  private String tenntd;
  private long soviec;
  private String anh;

  public topctybean() {
    super();
    // TODO Auto-generated constructor stub
  }

  public topctybean(String tenntd, long soviec, String anh) {
    super();
    this.tenntd = tenntd;
    this.soviec = soviec;
    this.anh = anh;
  }

  public String getTenntd() {
    return tenntd;
  }

  public void setTenntd(String tenntd) {
    this.tenntd = tenntd;
  }

  public long getSoviec() {
    return soviec;
  }

  public void setSoviec(long soviec) {
    this.soviec = soviec;
  }

  public String getAnh() {
    return anh;
  }

  public void setAnh(String anh) {
    this.anh = anh;
  }



}
